    const len = O.length >>> 0; // \u5C06length\u8F6C\u6362\u4E3A\u65E0\u7B26\u53F7\u6574\u578B
    const A = new Array(len); // \u521B\u5EFA\u65B0\u6570\u7EC4\u7528\u4E8E\u5B58\u50A8\u7ED3\u679C

    for (var k = 0; k < len; k++) {
      // \u68C0\u67E5k\u662F\u5426\u5728\u6570\u7EC4\u7684\u539F\u578B\u94FE\u4E0A
      if (k in O) {
        const kValue = O[k]; // \u83B7\u53D6\u6570\u7EC4\u7684\u5143\u7D20\u503C
        const mappedValue = callback.call(thisArg, kValue, k, O); // \u8C03\u7528callback
        A[k] = mappedValue; // \u5B58\u50A8\u8FD4\u56DE\u7684\u503C
      }
    }

